      <Layout>

    <p>This is the sleep page</p>

     <h2> Mood Form </h2>

        <SleepForm>
        </SleepForm>

      <h2> Mood Form </h2>
        <MoodForm>
        </MoodForm>
       </Layout>
    );
  }
